When the test command runs, it looks for all tests in all files in the directory. Tests can be either placed separate modules or in the same module as the code they test. First, let's add a test function to the hello_world module: module book::hello_world { use std::string::{Self, String}; public fun hello_world(): String { string::utf8(b"Hello, World!") } #[test] fun test_is_hello_world() { let expected = string::utf8(b"Hello, World!"); assert!(hello_world() == expected, 0) }
} The test function is a function with a #[test] attribute. Normally it takes no arguments (but it can take arguments in some cases - you'll learn more about it closer to the end of this book) and returns nothing. Tests placed in the same module as the code they test are called "unit tests". They can access all functions and types in the module. We'll go through them in more detail in the Test section. #[test] fun test_is_hello_world() { let expected = string::utf8(b"Hello, World!"); assert!(hello_world() == expected, 0) } Inside the test function, we define the expected outcome by creating a String with the expected value and assign it to the expected variable. Then we use the special built-in assert!() which takes two arguments: a conditional expression and an error code. If the expression evaluates to false, then the test fails with the given error code. The equality operator == compares the actual and expected values and returns true if they are equal. We'll learn more about expressions in the Expression and Scope section. Now let's run the test command again: $ sui move test You should see this output, which means that the test has run successfully: ...
Test result: OK. Total tests: 1; passed: 1; failed: 0

