Function is a block of code that contains a sequence of statements and expressions. Function can take arguments and return a value. Function is declared with the fun keyword. module book::my_module { fun my_function() {}
} Like any module member, functions are accessed via a path. The path consists of the module path and the function name separated by ::. For example, if you have a function called my_function in the my_module module in the book package, the path to it will be book::my_module::my_function. Functions can be called in a transaction. User can send a transaction containing a call to a function, and the function will be executed on the blockchain. We will learn more about transactions in the Transaction section. Any public function can be called in a transaction. So, if we made the my_function public, we can call it in a transaction: module book::my_module { public fun my_function() {}
} To call it, a user would need to send a transaction containing a "move-call", which would roughly look like this: sui client call \ --package 0x... \ --module book::my_module \ --function my_function \ --gas-budget 10000000 Having said that, Move modules define the interface of the package. For example, if there's a need to implement a database-like system with addition, modification and deletion of records, the module would define a matching set of functions. And users would be able to call those functions in transactions.

