Let's create a new module called hello_world. To do so, create a new file in the sources folder called hello_world.move. So that the structure looks like this: sources/ hello_world.move
Move.toml And then add the following code to the hello_world.move file: // sources/hello_world.move
module book::hello_world { use std::string::{Self, String}; public fun hello_world(): String { string::utf8(b"Hello, World!") }
} While it's not a hard restriction, it's is considered a good practice to name the module the same as the file. So, in our case, the module name is hello_world and the file name is hello_world.move. The module name and function names should be in snake_case - all lowercase letters with underscores between words. You can read more about coding conventions in the Coding Conventions section.
